import React, { useState } from "react";
import parse from "csv-parse/lib/sync";
import csvData from "./data.csv";

export const Results = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const parsedData = parse(csvData, { columns: true });

  const player = parsedData.find(
    (data) => data.player_name.toLowerCase() === searchTerm.toLowerCase()
  );

  return (
    <div>
      <input
        type="text"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <table>
        <thead>
          <tr>
            <th>Player Name</th>
            <th>Pitch Type</th>
            <th>Stuff Grade</th>
            <th>Release Speed</th>
            <th>InducedVertBreak</th>
          </tr>
        </thead>
        <tbody>
          {parsedData.map((data, index) => (
            <tr key={index}>
              <td>{data.player_name}</td>
              <td>{data.pitch_type}</td>
              <td>{data.stuffGrade}</td>
              <td>{data.release_speed}</td>
              <td>{data.InducedVertBreak}</td>
            </tr>
          ))}
        </tbody>
      </table>
      {player ? (
        <p>{player.stuffGrade}</p>
      ) : (
        <p>Player not found</p>
      )}
    </div>
  );
};
